import React, { useEffect } from 'react';

const Favicon = () => {
    const url = "data:image/png;base64,";

    useEffect(() => {
        const link = document.createElement('link');
        link.rel = 'icon';
        link.href = url;
        document.head.appendChild(link);
        return () => {
            document.head.removeChild(link);
        };
    }, [url]);

    return null;
};

export default Favicon;
